import React from "react";
import NavBar from "./NavBar";

function Browse() {
  window.addEventListener("scroll", function () {
    if (window.scrollY >= 100) {
      document.body.style.backgroundColor = "red";
    }
  });
  return (
    <div className="app">
      <NavBar />
    </div>
  );
}

export default Browse;
